#include <iostream>
#include <vector>
#include <algorithm>
#include <string>
#include <queue>

using namespace std;

class Solution 
{
public:

	void mark(vector<vector<char>>& board, int i, int j, vector<vector<bool>>& visited)
	{
		queue<pair<int, int>> a;

		a.push({ i, j });
		visited[i][j] = true;

		while (!a.empty())
		{
			pair<int, int> pos = a.front();

			i = pos.first;
			j = pos.second;
			board[i][j] = 1;

			a.pop();

			if (i > 0 && board[i - 1][j] == 'O' && visited[i - 1][j] == false)
			{
				a.push({ i - 1, j });
				visited[i - 1][j] = true;
			}
				

			if (j > 0 && board[i][j - 1] == 'O' && visited[i][j - 1] == false)
			{
				a.push({ i, j - 1 });
				visited[i][j - 1] = true;
			}
				

			if (i < board.size() - 1 && board[i + 1][j] == 'O' && visited[i + 1][j] == false)
			{
				a.push({ i + 1, j });
				visited[i + 1][j] = true;
			}

			if (j < board[0].size() - 1 && board[i][j + 1] == 'O' && visited[i][j + 1] == false)
			{
				a.push({ i, j + 1 });
				visited[i][j + 1] = true;
			}
		}

		
	}

	void solve(vector<vector<char>>& board) 
	{
		if (board.size() <= 0 || board[0].size() <= 0)
			return;

		
		vector<vector<bool>> visited(board.size(), vector<bool>(board[0].size()));

		for (int i = 0, j = 0; i < board.size(); i++)
		{
			if (board[i][j] == 'O' && visited[i][j] == false)
				mark(board, i, j, visited);
		}

		for (int i = 0, j = board[0].size() - 1; i < board.size(); i++)
		{
			if (board[i][j] == 'O' && visited[i][j] == false)
				mark(board, i, j, visited);
		}

		for (int j = 0, i = 0; j < board[0].size(); j++)
		{
			if (board[i][j] == 'O' && visited[i][j] == false)
				mark(board, i, j, visited);
		}

		for (int j = 0, i = board.size() - 1; j < board[0].size(); j++)
		{
			if (board[i][j] == 'O' && visited[i][j] == false)
				mark(board, i, j, visited);
		}


		for (int i = 0; i < board.size(); i++)
		{
			for (int j = 0; j < board[0].size(); j++)
			{
				if (board[i][j] == 1)
					board[i][j] = 'O';
				else
					board[i][j] = 'X';
			}
		}
	}
};

vector<vector<char>> get_vec(vector<string>& v)
{
	vector<vector<char>> res (v.size(), vector<char>(v[0].length()));

	for (int i = 0; i < v.size(); i++)
	{
		for (int j = 0; j < v[i].length(); j++)
			res[i][j] = v[i][j];
	}

	return move(res);
}

